"""

---


# Funciones optimizadas para sacar buenos parámetros y datos sobre los resultados futuros obtenidos por el modelo para realizar las historias y los gráficos. Se guardan los parámetros de la época con mejor dev_acc para al final ser cargada, protegiéndonos del overfitting:"""

# Evaluate también devuelva el accuracy para poder usarlo en el bucle
def evaluate(model, test_loader):
    device = torch.device("cuda" if torch.cuda.is_available() else "cpu")
    model.eval()  # Poner el modelo en modo evaluación
    correct = 0
    total = test_loader.dataset.__len__()  # Total de muestras en el conjunto de test
    with torch.no_grad():  # No calcular gradientes
        for inputs, labels in test_loader:
            inputs, labels = inputs.to(device), labels.to(device)  # Mover datos al dispositivo
            outputs = model(inputs)  # Forward pass
            _, predicted = torch.max(outputs, 1)  # Obtener las predicciones
            correct += (predicted == labels).sum().item()  # Actualizar el contador de aciertos
    accuracy = 100 * correct / total if total > 0 else 0.0
    return accuracy

import copy
from torch.optim.lr_scheduler import ReduceLROnPlateau

def train_with_validation(model, train_loader, dev_loader, criterion, optimizer, epochs=5):
    device = torch.device("cuda" if torch.cuda.is_available() else "cpu")
    model.to(device)

    scheduler = ReduceLROnPlateau(optimizer, mode='max', factor=0.5, patience=4)

    history = {'train_loss': [], 'train_acc': [], 'dev_loss': [], 'dev_acc': [], 'lr': []
    }
    best_acc = 0.0
    best_model_wts = copy.deepcopy(model.state_dict())

    for epoch in range(epochs):
        # --- entrenamiento ---
        model.train()
        running_loss, correct, total = 0.0, 0, 0

        for inputs, labels in train_loader:
            inputs, labels = inputs.to(device), labels.to(device)
            optimizer.zero_grad()
            outputs = model(inputs)
            loss = criterion(outputs, labels)
            loss.backward()
            optimizer.step()
            running_loss += loss.item()
            _, predicted = torch.max(outputs, 1)
            correct += (predicted == labels).sum().item()
            total += labels.size(0)

        avg_train_loss = running_loss / len(train_loader)
        train_acc = 100 * correct / total

        # --- validación ---
        model.eval()
        dev_loss, correct, total = 0.0, 0, 0
        with torch.no_grad():
            for inputs, labels in dev_loader:
                inputs, labels = inputs.to(device), labels.to(device)
                outputs = model(inputs)
                loss = criterion(outputs, labels)
                dev_loss += loss.item()
                _, predicted = torch.max(outputs, 1)
                correct += (predicted == labels).sum().item()
                total += labels.size(0)
        avg_dev_loss = dev_loss / len(dev_loader)
        dev_acc = 100 * correct / total

        # ---- Reducir LR si no mejora ----
        scheduler.step(dev_acc)
        # Guardar LR actual
        current_lr = optimizer.param_groups[0]['lr']

        # --- guardar histórico ---
        history['train_loss'].append(avg_train_loss)
        history['train_acc'].append(train_acc)
        history['dev_loss'].append(avg_dev_loss)
        history['dev_acc'].append(dev_acc)
        history['lr'].append(current_lr)


        # --- guardar mejor modelo ---
        if dev_acc > best_acc:
            best_acc = dev_acc
            best_model_wts = copy.deepcopy(model.state_dict())

        print(f"[Epoch {epoch + 1}/{epochs}] "
          f"train_loss: {avg_train_loss:.3f}, train_acc: {train_acc:.2f}% | "
          f"dev_loss: {avg_dev_loss:.3f}, dev_acc: {dev_acc:.2f}% | "
          f"LR: {current_lr:.6f}")


    # --- restaurar mejor modelo ---
    model.load_state_dict(best_model_wts)
    print(f"\n✅ Entrenamiento finalizado. Mejor dev_acc = {best_acc:.2f}%")

    return model, history

"""

---


#Función que dibuja las curvas de loss y accuracy (train y dev) guardadas en el diccionario 'history' usando 'train_loss', 'train_acc', 'dev_loss', 'dev_acc' sacados por train_with_validation y evaluate:"""

def plot_training_history(history):

    epochs = range(1, len(history['train_loss']) + 1)

    # --- Loss ---
    plt.figure(figsize=(10, 4))
    plt.subplot(1, 2, 1)
    plt.plot(epochs, history['train_loss'], label='Train Loss')
    plt.plot(epochs, history['dev_loss'], label='Validation Loss')
    plt.xlabel('Epoch')
    plt.ylabel('Loss')
    plt.title('Training and Validation Loss')
    plt.legend()
    plt.grid(True)

    # --- Accuracy ---
    plt.subplot(1, 2, 2)
    plt.plot(epochs, history['train_acc'], label='Train Accuracy')
    plt.plot(epochs, history['dev_acc'], label='Validation Accuracy')
    plt.xlabel('Epoch')
    plt.ylabel('Accuracy (%)')
    plt.title('Training and Validation Accuracy')
    plt.legend()
    plt.grid(True)

    plt.tight_layout()
    plt.show()

def seed_everything(seed):
    import random
    import torch
    torch.manual_seed(seed)
    if torch.cuda.is_available():
        torch.cuda.manual_seed_all(seed)
        torch.backends.cudnn.deterministic = True
    np.random.seed(seed)
    random.seed(seed)

