"""---
#***Modelo animalsClassifier_v1***

Modelo de red neuronal convolucional simple en PyTorch para clasificar imágenes en 10 clases. Se fijan los hiperparámetros básicos (batch size, learning rate y número de épocas). El modelo tiene dos capas convolucionales: la primera transforma la imagen de 3 canales a 32 canales, y la segunda de 32 a 64 canales. Después de cada convolución se aplica una activación ReLU y un MaxPool para reducir a la mitad el tamaño de la imagen. Tras las convoluciones, se aplana el resultado y se usa una capa LazyLinear para generar la predicción final. En resumen, es una CNN básica con dos convoluciones, dos poolings y una capa totalmente conectada al final.
"""

import torch
import torch.nn as nn
import torch.nn.functional as F

# Hiperparámetros
BATCH_SIZE = 64
LR = 0.0005
EPOCHS = 30

class animalsClassifier_v1(nn.Module):
    def __init__(self, in_channels=3, num_classes=10):
        super().__init__()

        # Capa 1
        self.conv1 = nn.Conv2d(in_channels, 32, kernel_size=3, padding=1)
        # Capa 2
        self.pool1 = nn.MaxPool2d(2, 2)
        # Capa 3
        self.conv2 = nn.Conv2d(32, 64, kernel_size=3, padding=1)
        # Capa 4
        self.pool2 = nn.MaxPool2d(2, 2)
        # Capa 5
        self.fc = nn.LazyLinear(num_classes)

    def forward(self, x):
        x = F.relu(self.conv1(x))
        x = self.pool1(x)
        x = F.relu(self.conv2(x))
        x = self.pool2(x)
        x = torch.flatten(x, 1)
        x = self.fc(x)
        return x

# --- Instanciar modelo ---
model = animalsClassifier_v1().to(device)

# --- Criterio y optimizador ---
criterion = nn.CrossEntropyLoss()
optimizer = optim.Adam(model.parameters(), lr=LR)

# training + validación
model_mammalClassifier_vv1, history = train_with_validation(
    model=model,
    train_loader=train_loader,
    dev_loader=test_loader,
    criterion=criterion,
    optimizer=optimizer,
    epochs=EPOCHS
)

plot_training_history(history)

