"""---
#***Modelo animalsClassifier_v3***
"""

import torch
import torch.nn as nn
import torch.nn.functional as F

# Hiperparámetros
BATCH_SIZE = 64
LR = 0.0005
EPOCHS = 70


class animalsClassifier_v3(nn.Module):
    def __init__(self, num_classes=10):
        super().__init__()

        # ---------- BLOQUE 1 ----------
        self.conv1_1 = nn.Conv2d(3, 32, kernel_size=3, padding=1)
        self.bn1_1   = nn.BatchNorm2d(32)
        self.conv1_2 = nn.Conv2d(32, 32, kernel_size=3, padding=1)
        self.bn1_2   = nn.BatchNorm2d(32)
        self.pool1   = nn.MaxPool2d(2, 2)   # 300x240 -> 150x120

        # ---------- BLOQUE 2 ----------
        self.conv2_1 = nn.Conv2d(32, 64, kernel_size=3, padding=1)
        self.bn2_1   = nn.BatchNorm2d(64)
        self.conv2_2 = nn.Conv2d(64, 64, kernel_size=3, padding=1)
        self.bn2_2   = nn.BatchNorm2d(64)
        self.pool2   = nn.MaxPool2d(2, 2)   # 150x120 -> 75x60

        # ---------- BLOQUE 3 ----------
        self.conv3_1 = nn.Conv2d(64, 128, kernel_size=3, padding=1)
        self.bn3_1   = nn.BatchNorm2d(128)
        self.conv3_2 = nn.Conv2d(128, 128, kernel_size=3, padding=1)
        self.bn3_2   = nn.BatchNorm2d(128)
        self.pool3   = nn.MaxPool2d(2, 2)   # 75x60 -> 38x30

        # ---------- BLOQUE 4 ----------
        self.conv4_1 = nn.Conv2d(128, 256, kernel_size=3, padding=1)
        self.bn4_1   = nn.BatchNorm2d(256)
        self.conv4_2 = nn.Conv2d(256, 256, kernel_size=3, padding=1)
        self.bn4_2   = nn.BatchNorm2d(256)
        self.pool4   = nn.MaxPool2d(2, 2)   # 38x30 -> 19x15

        # ---------- BLOQUE 5 ----------
        self.conv5_1 = nn.Conv2d(256, 512, kernel_size=3, padding=1)
        self.bn5_1   = nn.BatchNorm2d(512)
        self.conv5_2 = nn.Conv2d(512, 512, kernel_size=3, padding=1)
        self.bn5_2   = nn.BatchNorm2d(512)


        self.gap = nn.AdaptiveAvgPool2d((1, 1))

        # ---------- CLASIFICADOR ----------
        self.dropout = nn.Dropout(0.5)
        self.fc1 = nn.Linear(512, 256)
        self.fc2 = nn.Linear(256, 128)
        self.fc3 = nn.Linear(128, num_classes)


    def forward(self, x):

        # ----- BLOQUE 1 -----
        x = F.leaky_relu(self.bn1_1(self.conv1_1(x)), 0.1)
        x = F.leaky_relu(self.bn1_2(self.conv1_2(x)), 0.1)
        x = self.pool1(x)

        # ----- BLOQUE 2 -----
        x = F.leaky_relu(self.bn2_1(self.conv2_1(x)), 0.1)
        x = F.leaky_relu(self.bn2_2(self.conv2_2(x)), 0.1)
        x = self.pool2(x)

        # ----- BLOQUE 3 -----
        x = F.leaky_relu(self.bn3_1(self.conv3_1(x)), 0.1)
        x = F.leaky_relu(self.bn3_2(self.conv3_2(x)), 0.1)
        x = self.pool3(x)

        # ----- BLOQUE 4 -----
        x = F.leaky_relu(self.bn4_1(self.conv4_1(x)), 0.1)
        x = F.leaky_relu(self.bn4_2(self.conv4_2(x)), 0.1)
        x = self.pool4(x)

        # ----- BLOQUE 5 -----
        x = F.leaky_relu(self.bn5_1(self.conv5_1(x)), 0.1)
        x = F.leaky_relu(self.bn5_2(self.conv5_2(x)), 0.1)

        # GAP
        x = self.gap(x)
        x = x.view(x.size(0), -1)   # [B, 512]

        # Clasificador
        x = self.dropout(F.leaky_relu(self.fc1(x), 0.1))
        x = self.dropout(F.leaky_relu(self.fc2(x), 0.1))
        x = self.fc3(x)

        return x

# --- Instanciar modelo ---
model = animalsClassifier_v3().to(device)

# --- Criterio y optimizador ---
criterion = nn.CrossEntropyLoss()
optimizer = optim.Adam(model.parameters(), lr=LR)

# training + validación
model_mammalClassifier_vv3, history = train_with_validation(
    model=model,
    train_loader=train_loader,
    dev_loader=test_loader,
    criterion=criterion,
    optimizer=optimizer,
    epochs=EPOCHS
)

plot_training_history(history)

"""---
#***Modelo animalsClassifier_v4***

modelo v3 con modificaciones.

Cambios añadidos:

LeakyReLU → PReLU

Dropout más inteligente (0.3 en convolucional, 0.5 en denso)

LayerNorm en el clasificador (ayuda a estabilizar)

Última capa Conv5 con pooling ligero (Mejora generalización)

Pequeño weight decay añadido internamente con normalization
"""

import torch
import torch.nn as nn
import torch.nn.functional as F

# Hiperparámetros
BATCH_SIZE = 64
LR = 0.0005
EPOCHS = 70


class animalsClassifier_v4(nn.Module):
    def __init__(self, num_classes=10):
        super().__init__()

        # ---------- BLOQUE 1 ----------
        self.conv1_1 = nn.Conv2d(3, 32, kernel_size=3, padding=1)
        self.bn1_1   = nn.BatchNorm2d(32)
        self.conv1_2 = nn.Conv2d(32, 32, kernel_size=3, padding=1)
        self.bn1_2   = nn.BatchNorm2d(32)
        self.pool1   = nn.MaxPool2d(2, 2)

        # ---------- BLOQUE 2 ----------
        self.conv2_1 = nn.Conv2d(32, 64, kernel_size=3, padding=1)
        self.bn2_1   = nn.BatchNorm2d(64)
        self.conv2_2 = nn.Conv2d(64, 64, kernel_size=3, padding=1)
        self.bn2_2   = nn.BatchNorm2d(64)
        self.pool2   = nn.MaxPool2d(2, 2)

        # ---------- BLOQUE 3 ----------
        self.conv3_1 = nn.Conv2d(64, 128, kernel_size=3, padding=1)
        self.bn3_1   = nn.BatchNorm2d(128)
        self.conv3_2 = nn.Conv2d(128, 128, kernel_size=3, padding=1)
        self.bn3_2   = nn.BatchNorm2d(128)
        self.pool3   = nn.MaxPool2d(2, 2)

        # ---------- BLOQUE 4 ----------
        self.conv4_1 = nn.Conv2d(128, 256, kernel_size=3, padding=1)
        self.bn4_1   = nn.BatchNorm2d(256)
        self.conv4_2 = nn.Conv2d(256, 256, kernel_size=3, padding=1)
        self.bn4_2   = nn.BatchNorm2d(256)
        self.pool4   = nn.MaxPool2d(2, 2)

        # ---------- BLOQUE 5 ----------
        self.conv5_1 = nn.Conv2d(256, 512, kernel_size=3, padding=1)
        self.bn5_1   = nn.BatchNorm2d(512)
        self.conv5_2 = nn.Conv2d(512, 512, kernel_size=3, padding=1)
        self.bn5_2   = nn.BatchNorm2d(512)
        self.pool5   = nn.MaxPool2d(2, 2)   # NUEVO → mejora generalización

        # GAP
        self.gap = nn.AdaptiveAvgPool2d((1, 1))

        # Activación paramétrica (mejor que LeakyReLU)
        self.prelu = nn.PReLU()

        # ---------- CLASIFICADOR ----------
        self.dropout1 = nn.Dropout(0.3)
        self.dropout2 = nn.Dropout(0.5)

        self.fc1 = nn.Linear(512, 256)
        self.ln1 = nn.LayerNorm(256)  # layernorm agrega estabilidad

        self.fc2 = nn.Linear(256, 128)
        self.ln2 = nn.LayerNorm(128)

        self.fc3 = nn.Linear(128, num_classes)


    def forward(self, x):

        # ---- BLOQUE 1 ----
        x = self.prelu(self.bn1_1(self.conv1_1(x)))
        x = self.prelu(self.bn1_2(self.conv1_2(x)))
        x = self.pool1(x)

        # ---- BLOQUE 2 ----
        x = self.prelu(self.bn2_1(self.conv2_1(x)))
        x = self.prelu(self.bn2_2(self.conv2_2(x)))
        x = self.pool2(x)

        # ---- BLOQUE 3 ----
        x = self.prelu(self.bn3_1(self.conv3_1(x)))
        x = self.prelu(self.bn3_2(self.conv3_2(x)))
        x = self.pool3(x)

        # ---- BLOQUE 4 ----
        x = self.prelu(self.bn4_1(self.conv4_1(x)))
        x = self.prelu(self.bn4_2(self.conv4_2(x)))
        x = self.pool4(x)

        # ---- BLOQUE 5 ----
        x = self.prelu(self.bn5_1(self.conv5_1(x)))
        x = self.prelu(self.bn5_2(self.conv5_2(x)))
        x = self.pool5(x)   # nuevo

        # GAP
        x = self.gap(x)
        x = torch.flatten(x, 1)

        # ---- CLASIFICADOR ----
        x = self.dropout1(self.prelu(self.ln1(self.fc1(x))))
        x = self.dropout2(self.prelu(self.ln2(self.fc2(x))))
        x = self.fc3(x)

        return x

# --- Instanciar modelo ---
model = animalsClassifier_v4().to(device)

# --- Criterio y optimizador ---
criterion = nn.CrossEntropyLoss()
optimizer = optim.Adam(model.parameters(), lr=LR)

# training + validación
model_mammalClassifier_vv4, history = train_with_validation(
    model=model,
    train_loader=train_loader,
    dev_loader=test_loader,
    criterion=criterion,
    optimizer=optimizer,
    epochs=EPOCHS
)

plot_training_history(history)

"""---
#***Modelo animalsClassifier_v5***

Modelo mejorado final, hecho con ayuda de la ia (CHATGPT) que implementa un bloque convolucional residual que aplica dos convoluciones con normalización y activación, añade una conexión residual para mejorar el flujo del gradiente y, opcionalmente, reduce la resolución mediante MaxPool. Con este bloque se construye el modelo principal, formado por cinco bloques residuales que van aumentando progresivamente el número de canales para extraer características cada vez más complejas. Después, la red aplica un global average pooling para reducir todo el mapa de características a un vector fijo y pasa ese vector a un clasificador denso compuesto por capas LazyLinear, activaciones GELU/LeakyReLU y dropout para reducir sobreajuste. Finalmente, la red devuelve una predicción con tantas salidas como clases tenga el problema.
"""

import torch
import torch.nn as nn
import torch.nn.functional as F

# Hiperparámetros
BATCH_SIZE = 64
LR = 0.0005
EPOCHS = 65


# ---- Bloque convolucional con conexión residual ----
class ResidualConvBlock(nn.Module):
    def __init__(self, in_ch, out_ch, pool=True):
        super().__init__()
        self.conv = nn.Sequential(
            nn.Conv2d(in_ch, out_ch, kernel_size=3, padding=1),
            nn.BatchNorm2d(out_ch),
            nn.LeakyReLU(0.1, inplace=True),

            nn.Conv2d(out_ch, out_ch, kernel_size=3, padding=1),
            nn.BatchNorm2d(out_ch)
        )

        # Para igualar dimensiones en la conexión residual si cambian canales
        self.shortcut = nn.Conv2d(in_ch, out_ch, 1) if in_ch != out_ch else nn.Identity()
        self.act = nn.LeakyReLU(0.1, inplace=True)
        self.pool = nn.MaxPool2d(2, 2) if pool else nn.Identity()

    def forward(self, x):
        out = self.conv(x)
        out += self.shortcut(x)
        out = self.act(out)
        return self.pool(out)


# ---- Modelo CNN mejorado con LazyLinear y residuals ----
class animalsClassifier_v5(nn.Module):
    def __init__(self, num_classes=10):
        super().__init__()

        self.block1 = ResidualConvBlock(3, 64)       # 300x240 -> 150x120
        self.block2 = ResidualConvBlock(64, 128)     # -> 75x60
        self.block3 = ResidualConvBlock(128, 256)    # -> 38x30
        self.block4 = ResidualConvBlock(256, 512)    # -> 19x15
        self.block5 = ResidualConvBlock(512, 768, pool=False)  # mayor capacidad

        self.global_pool = nn.AdaptiveAvgPool2d((1, 1))

        # Capas densas con LazyLinear
        self.fc = nn.Sequential(
            nn.Flatten(),
            nn.Dropout(0.5),
            nn.LazyLinear(512),       # detecta automáticamente la entrada
            nn.GELU(),
            nn.Dropout(0.3),
            nn.LazyLinear(256),
            nn.LeakyReLU(0.1, inplace=True),
            nn.Linear(256, num_classes)
        )

    def forward(self, x):
        x = self.block1(x)
        x = self.block2(x)
        x = self.block3(x)
        x = self.block4(x)
        x = self.block5(x)
        x = self.global_pool(x)
        x = self.fc(x)
        return x

# --- Instanciar modelo ---
model = animalsClassifier_v5().to(device)

# --- Criterio y optimizador ---
criterion = nn.CrossEntropyLoss()
optimizer = optim.Adam(model.parameters(), lr=LR)

