"""---


#***TRANSFER LEARNING RESNET 34***

ResNet-34 es una arquitectura de red neuronal convolucional (CNN) de 34 capas, que destaca por usar conexiones residuales (skip connections) para facilitar el entrenamiento de redes profundas. Se preentrena con el conjunto de datos ImageNet, lo que le permite realizar tareas de clasificación de imágenes de forma eficiente. Su diseño permite superar el problema del gradiente que se desvanece (vanishing gradient), una limitación común en redes neuronales muy profundas.
"""

import torch
import torch.nn as nn
import torch.nn.functional as F
import torchvision.models as models
from torch.optim import Adam
from torch.optim.lr_scheduler import ReduceLROnPlateau

# --- Hiperparámetros ---
BATCH_SIZE = 64
LR = 1e-4
EPOCHS = 4

# --- Modelo con Transfer Learning ---
class AnimalsResNet34_Lazy(nn.Module):
    def __init__(self, num_classes=10):
        super(AnimalsResNet34_Lazy, self).__init__()
        # Cargar modelo base preentrenado en ImageNet
        self.base_model = models.resnet34(weights=models.ResNet34_Weights.DEFAULT)

        # Congelar capas base
        for param in self.base_model.parameters():
            param.requires_grad = False

        # Descongelar la última capa convolucional
        for param in self.base_model.layer4.parameters():
            param.requires_grad = True

        # Reemplazar la última capa fully connected con LazyLinear
        self.base_model.fc = nn.Sequential(
            nn.LazyLinear(512),
            nn.BatchNorm1d(512),
            nn.LeakyReLU(0.1, inplace=True),
            nn.Dropout(0.5),
            nn.LazyLinear(256),
            nn.BatchNorm1d(256),
            nn.LeakyReLU(0.1, inplace=True),
            nn.Dropout(0.3),
            nn.LazyLinear(num_classes)
        )

    def forward(self, x):
        return self.base_model(x)

"""![electronics-12-03677-g004.jpg](data:image/jpeg;base64,)"""

# --- Instanciar modelo, criterio y optimizador ---
model = AnimalsResNet34_Lazy(num_classes=10)
device = torch.device("cuda" if torch.cuda.is_available() else "cpu")
criterion = nn.CrossEntropyLoss()
optimizer = Adam(filter(lambda p: p.requires_grad, model.parameters()), lr=LR)

# --- Entrenar modelo ---
model_resnet34_lazy, history = train_with_validation(
    model=model,
    train_loader=train_loader,
    dev_loader=test_loader,
    criterion=criterion,
    optimizer=optimizer,
    epochs=EPOCHS
)

